  \"2013-03-15T14:35:56.710808\",\n\t\"name\": \"transstats-hpms93\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Highway Performance Monitoring System
  (HPMS) is a spreadsheet maintained by the VT Agency of Transportation (VTrans).
  The spreadsheet contains references to milemarkers for each section of state-aid
  highway, which were linked to the route system in layer RDSRDSRT (version 4/26/94)
  and converted to a line data layer. The HPMS spreadsheet was provided to VCGI on
  10/11/93. HPMS consists of 'universe elements' (all records) and 'sample elements'
  for a subset of sample records. In the VTrans spreadsheets, the sample sections
  include more detailed information than for the universe elements. Only the information
  available for all universe elements is included with TransStats_HPMS93.\",\n\t\"license_title\":
